import { Appbar, Searchbar } from 'react-native-paper';

export default function KelasScreen({ navigation }) {
	return (
		<>
			<Appbar.Header>
				<Appbar.BackAction onPress={() => navigation.goBack()} />
				<Appbar.Content title="Kelas" />
			</Appbar.Header>

			<Searchbar
				placeholder="Search"
			/>
			<Button icon="plus" mode="contained" onPress={() => navigation.navigate('KelasScreen')} style={{ margin: 10 }}>Gabung</Button>
		</>
	);
}
